def run(value_list):
    """
    Calculates the change in leasehold external valuation % from 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple containing the percentage change and its scale.
    """

    initial_year = 2018
    final_year = 2019

    initial_valuation = None
    final_valuation = None

    for item in value_list:
        if item['header1'] == f'Year ended {initial_year}':
            if item['category'] == 'Leasehold' and item['header2'] == 'External valuaion %':
                initial_valuation = item['number_value']
        if item['header1'] == f'Year ended {final_year}':
            if item['category'] == 'Leasehold' and item['header2'] == 'External valuaion %':
                final_valuation = item['number_value']

    if initial_valuation is not None and final_valuation is not None:
        percentage_change = ((final_valuation - initial_valuation) / initial_valuation) * 100
        scale = '%'
        return (round(percentage_change, 2), scale)
    else:
        return (None, '')

